import React, { useEffect, useState } from "react";
import {Table, Button, Col, Container, Form, FormControl, InputGroup, Row } from "react-bootstrap";
import { getNews } from "../../actions/newsAction";
import Footer from "../../components/footer/Footer";
import Header from "../../components/header/Header";


const Dashboard = () => {

    const [newsData, setNewsData] = useState([]);
    
    let result;

    useEffect(()=>{
        result = getNews();
        result.then((res)=>{
            setNewsData(res);
            // console.log(res);
        });

    },[]);

    console.log(newsData)

    

    return (
        <>
        <Header/>
            <Table striped hover bordered size="sm">
                <thead>
                    <td>Title</td>
                    <td>Type</td>
                    <td>News</td>
                    <td>Action</td>
                </thead>
                <tbody>
                    {newsData?.map((obj) => {
                        return (
                            <>
                                <tr>
                                    <td>{obj.title}</td>
                                    <td>{obj.type}</td>
                                    <td>{obj.news}</td>
                                </tr>
                            </>
                        )
                    })}
                </tbody>
            </Table>
            <Footer/>
        </>
    )
}

export default Dashboard;
